import TeacherHeader from "./TeacherHeader";
import { useState, useEffect  } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import Swal from "sweetalert2";

const baseUrl='http://127.0.0.1:8000/api';

function TeacherProfileSettings() {
    useEffect(()=>{
        document.title='Profile Settings';
      });

      const teacherId=localStorage.getItem('teacherId');

      const [teacherData, setteacherData] = useState({
        'full_name': '',
        'email': '',
        'qualification': '',
        'mobile_no': '',
        'skills': '',
        'profile_fimg': '',
        'p_img': '',
        'status': ''
      });

     
    useEffect(()=>{

          //fetch current teacher data
          try{
            axios.get(baseUrl + '/teacher/'+ teacherId).then((res)=>{
                setteacherData({
                    full_name: res.full_name,
                    email: res.email,
                    qualification: res.qualification,
                    mobile_no: res.mobile_no,
                    skills: res.skills,
                    profile_fimg: res.featured_img,
                    p_img: ''

                });
            });
          }catch(error){
            console.log(error);
          }
          //End

      
    }, []);

        //Change Element Value
  const handleChange=(event)=>{
    setteacherData({
      ...teacherData,
      [event.target.name]: event.target.value
    });
  }

  const handleFileChange=(event)=>{
    setteacherData({
      ...teacherData,
      [event.target.name]: event.target.files[0]
    });
  }

  const submitForm=()=>{
    const teacherFormData = new FormData();
    teacherFormData.append("full_name", teacherData.full_name)
    teacherFormData.append("email", teacherData.email)
    teacherFormData.append("qualification", teacherData.qualification)
    teacherFormData.append("mobile_no", teacherData.mobile_no)
    teacherFormData.append("skills", teacherData.skills)

    if(teacherData.p_img !==''){
        teacherFormData.append('profile_img', teacherData.p_img, teacherData.p_img.name)
    }

    try{
      axios.put(baseUrl + '/teacher/'+ teacherId + '/', teacherFormData).then((response)=>{
        setteacherData({
          'full_name': '',
          'email': '',
          'qualification': '',
          'mobile_no': '',
          'skills': '',
          'profile_fimg': '',
          'p_img': '',
          'status': 'success'
        });
      });
    }catch(error){
        console.log(error);
        setteacherData({'status': 'error'});
    }

    

  };

  const teacherLoginStatus=localStorage.getItem('teacherLoginStatus')
  if(teacherLoginStatus!=='true'){
    window.location.href='/teacher-login';
  }
    return (
        <>
        <TeacherHeader />
        Profile settings
        <form>
           <div className="form-group">
             <input name="full_name" value={teacherData.full_name} onChange={handleChange} type="text" className="form-control" id="InputUsername1" aria-describedby="emailHelp" placeholder="Аты - жөні"></input>
           </div>

           <div className="form-group">
             <input name="email" value={teacherData.email} onChange={handleChange} type="email" className="form-control" id="InputEmail1" aria-describedby="emailHelp" placeholder="Электрондық пошта"></input>
           </div>

           <div className="form-group">
               <input name="p_img" onChange={handleFileChange} type="file" className="form-control" id="inputGroupFile03" aria-label="Upload" ></input>
               {teacherData.profile_img &&
                <img src={teacherData.profile_img.url} alt="opps!" width="300" />
               }
           </div>

           <div className="form-group">
             <input name="qualification" value={teacherData.qualification} onChange={handleChange} type="text" className="form-control" id="InputQualification1" aria-describedby="emailHelp" placeholder="Біліктілік"></input>
           </div>

           <div className="form-group">
             <textarea name="skills" value={teacherData.skills} onChange={handleChange} type="text" className="form-control" id="InputSkills" aria-describedby="emailHelp" placeholder="Қабілеттілік пен дағдылар"></textarea>
           </div>
           
           <div className="form-group">
             <button onClick={submitForm} type="submit">Update</button>
           </div>

         </form>
        </>
    );
}
export default TeacherProfileSettings;
